			"lyrics": "﻿[id:$00000000]\r\n[ar:曼 殊]\r\n[ti:归去来兮]\r\n[by:]\r\n[hash:1e317ddbd06dc16e82b79b72bcde0793]\r\n[al:]\r\n[sign:]\r\n[qq:]\r\n[total:205583]\r\n[offset:0]\r\n[00:00.03]曼殊 - 归去来兮\r\n[00:00.68]作词：花粥\r\n[00:00.85]作曲：花粥\r\n[00:01.16]原唱：花粥\r\n[00:16.36]余音袅袅我看了太多热闹\r\n[00:19.34]看一尘不染的白纸\r\n[00:20.86]都变得浮躁\r\n[00:22.69]善者寥寥在泥沼之中煎熬\r\n[00:25.84]而置身事外的君子\r\n[00:27.36]在一旁冷笑\r\n[00:29.19]没完没了的暗箭持续叫嚣\r\n[00:32.32]怕没人注意到\r\n[00:33.60]他们得意着作妖\r\n[00:35.68]纷纷扰扰这人间缺个公道\r\n[00:38.68]我辞三界\r\n[00:39.72]别五行自顾去逍遥\r\n[00:42.21]此去必经年\r\n[00:45.45]荒野寒暑换红颜\r\n[00:48.69]往事散云烟\r\n[00:51.89]十寸光阴换一钱\r\n[00:55.18] 只身山水间\r\n[00:58.37]耳不闻恶语闲言\r\n[01:01.65]举头问苍天\r\n[01:04.85]何时得以赴黄泉\r\n[01:34.19]走走停停又逛了几个世纪\r\n[01:37.13]看川流不息灯红酒绿\r\n[01:38.93]变成孤寂\r\n[01:40.50]战战兢兢的人们未曾怀疑\r\n[01:43.58]在此地 荣华富贵\r\n[01:45.19]是唯一的真理\r\n[01:47.04]机关算尽后徒留一地黄金\r\n[01:50.14]那冢里枯骨不得安息\r\n[01:51.91]无人在意\r\n[01:53.49]夜色降临时落下一声叹息\r\n[01:56.55]我乘兴来\r\n[01:57.65]败兴去也乐得随意\r\n[02:13.08]此去必经年\r\n[02:16.23]荒野寒暑换红颜\r\n[02:19.47]往事散云烟\r\n[02:22.71]十寸光阴换一钱\r\n[02:25.97]只身山水间\r\n[02:29.18]耳不闻恶语闲言\r\n[02:32.42]举头问苍天\r\n[02:35.68]何时得以赴黄泉\r\n[02:38.98]此去必经年\r\n[02:42.14]荒野寒暑换红颜\r\n[02:45.41]往事散云烟\r\n[02:48.61]十寸光阴换一钱\r\n[02:51.90]只身山水间\r\n[02:55.15]耳不闻恶语闲言\r\n[02:58.34]举头问苍天\r\n[03:01.59]何时得以赴黄泉\r\n",
