			"lyrics": "﻿[id:$00000000]\r\n[ar:韩红/林俊杰]\r\n[ti:飞云之下]\r\n[by:]\r\n[hash:b27641d27c37362cfbed0b3a9c0cb52d]\r\n[al:]\r\n[sign:]\r\n[qq:]\r\n[total:0]\r\n[offset:0]\r\n[00:00.26]韩红、林俊杰 - 飞云之下\r\n[00:04.84]作词：易家扬\r\n[00:05.69]作曲：林俊杰\r\n[00:06.42]编曲：Terence Teo\r\n[00:07.17]制作人：林俊杰\r\n[00:07.86]人声录音：林俊杰、瞿然、Leonard Fong、李岳松、黄冠龙\r\n[00:08.52]混音：周天澈、Richard Furch\r\n[00:09.94]封面设计：方亮\r\n[00:10.18]录音棚：HONG MUSIC STUDIO\r\n[00:16.40]女：\r\n[00:19.88]风 让云长出花 漫天的 花\r\n[00:26.79]无声开在乌云之下\r\n[00:30.62]然后 又飘到哪里呀\r\n[00:36.46]喔\r\n[00:36.85]男：\r\n[00:37.37]漫步在人海的人 你过得好吗\r\n[00:44.10]是不是又想念家\r\n[00:48.55]心中那炙热的梦啊\r\n[00:50.88]合：\r\n[00:52.44]它多久没说 话\r\n[00:56.91]女：\r\n[00:58.06]在飞云之下 以为忘了的家\r\n[01:02.25]在耳里说话\r\n[01:04.21]叫我别烦心那些痛与怕\r\n[01:08.24]男：\r\n[01:09.03]喔 半路上的我 穿上回忆和风沙\r\n[01:14.90]合：\r\n[01:15.47]在飞云之下\r\n[01:16.82]女：\r\n[01:17.29]我看着海峡\r\n[01:19.89]走月光沙滩\r\n[01:21.81]我也承认我还是会想他\r\n[01:26.62]喔 且慢 前面听说风很大\r\n[01:42.69]男：\r\n[01:45.22]心 在云里摩擦 又酸又麻\r\n[01:51.78]但是思念在梦里爬\r\n[01:55.37]以后 还有谁值得等吗\r\n[02:02.06]喔\r\n[02:02.60]女：\r\n[02:02.92]孤单是件风衣 它裹起了怕\r\n[02:09.17]然而我很勇敢啊\r\n[02:13.48]没人记得我也没差\r\n[02:16.34]合：\r\n[02:17.70]未来在等我去拿\r\n[02:22.57]女：\r\n[02:23.24]在飞云之下 以为忘了的家\r\n[02:27.49]在耳里说话\r\n[02:29.42]叫我别烦心那些痛与怕\r\n[02:33.27]男：\r\n[02:34.04]喔 半路上的我 穿上回忆和风沙\r\n[02:40.05]女：\r\n[02:40.71]在飞云之下 我看着海峡\r\n[02:45.00]走月光沙滩\r\n[02:46.42]合：\r\n[02:46.95]我也承认我还是会想他\r\n[02:51.18]女：\r\n[02:51.78]喔 且慢\r\n[02:55.00]男：\r\n[02:55.49]且慢\r\n[02:56.40]合：\r\n[02:57.25]前面听说风很大\r\n[03:03.96]喔\r\n[03:18.86]女：\r\n[03:19.99]在飞云之下 以为忘了的家\r\n[03:24.05]在耳里说话\r\n[03:25.96]叫我别烦心那些痛与怕\r\n[03:30.02]男：\r\n[03:30.88]半路上的我 穿上回忆和风沙\r\n[03:36.93]女：\r\n[03:37.71]飞云之下 我看着海峡\r\n[03:41.76]走月光沙滩\r\n[03:43.68]我也承认我还是会想他\r\n[03:49.82]合：\r\n[03:51.58]且慢 前面听说风很大\r\n[04:00.73]喔\r\n",
