			"lyrics": "[id:$00000000]\r\n[ar:上河Lin]\r\n[ti:盗将行]\r\n[by:八倍镜]\r\n[hash:d4eb517a405fcdf0286aa9a4487bbce1]\r\n[al:盗将行]\r\n[sign:]\r\n[qq:]\r\n[total:198034]\r\n[offset:0]\r\n[00:00.00]上河Lin、司南 - 盗将行\r\n[00:00.00]作词：姬霄\r\n[00:00.00]作曲：花粥\r\n[00:18.54]劫过九重城关\r\n[00:21.26]我座下马正酣\r\n[00:23.68]看那轻飘飘的衣摆\r\n[00:27.11]趁擦肩把裙掀\r\n[00:29.91]踏遍三江六岸\r\n[00:33.45]借刀光做船帆\r\n[00:36.09]任露水浸透了短衫\r\n[00:39.59]大盗睥睨四野\r\n[00:43.95]枕风宿雪多年\r\n[00:47.26]我与虎谋早餐\r\n[00:49.93]拎着钓叟的鱼弦\r\n[00:53.37] 问卧龙几两钱\r\n[00:56.02]蜀中大雨连绵\r\n[00:59.51]关外横尸遍野\r\n[01:02.10]你的笑像一条恶犬\r\n[01:05.25]撞乱了我心弦\r\n[01:23.25]谈花饮月赋闲\r\n[01:25.79]这春宵艳阳天\r\n[01:28.35]待到梦醒时分睁眼\r\n[01:31.83]铁甲寒意凛冽\r\n[01:34.49]夙愿只隔一箭\r\n[01:37.99]故乡近似天边\r\n[01:40.70]不知何人浅唱弄弦\r\n[01:44.27]我彷徨不可前\r\n[01:51.58]枕风宿雪多年\r\n[01:54.94]我与虎谋早餐\r\n[01:57.58]拎着钓叟的鱼弦\r\n[02:01.07]问卧龙几两钱\r\n[02:03.81]蜀中大雨连绵\r\n[02:07.22]关外横尸遍野\r\n[02:09.82]你的笑像一条恶犬\r\n[02:13.83]撞乱我心弦\r\n[02:16.10]烽烟万里如衔\r\n[02:19.52]掷群雄下酒宴\r\n[02:22.17]谢绝策勋十二转\r\n[02:25.64]想为你窃玉簪\r\n[02:28.34]入巷间吃汤面\r\n[02:31.78]笑看窗边飞雪\r\n[02:34.46]取腰间明珠弹山雀\r\n[02:37.99]立枇杷于庭前\r\n[02:46.03]入巷间吃汤面\r\n[02:49.83]笑看窗边飞雪\r\n[02:53.31]取腰间明珠弹山雀\r\n[02:57.45]立枇杷于庭前\r\n",
