			"lyrics": "﻿[id:$00000000]\r\n[ar:赵霏儿]\r\n[ti:出山]\r\n[by:]\r\n[hash:4245a963d109d202f68f34950a1c7f27]\r\n[al:]\r\n[sign:]\r\n[qq:]\r\n[total:202031]\r\n[offset:0]\r\n[00:00.05]赵霏儿 - 出山\r\n[00:00.89]作词：花粥\r\n[00:01.61]作曲：BachBeats LLC(BachBeats)\r\n[00:11.47]在夜半三更过天桥\r\n[00:13.90]从来不敢回头看\r\n[00:16.13]白日里是车水马龙\r\n[00:18.56]此时脚下是忘川\r\n[00:20.83]我独自走过 半山腰\r\n[00:23.21]山间野狗来作伴\r\n[00:25.49]层林尽染百舸流\r\n[00:27.82]秋风吹过鬼门关\r\n[00:30.20]一瞬三年五载\r\n[00:32.53]品粗茶 食淡饭\r\n[00:34.90]六界八荒四海\r\n[00:37.19]无人与我来叫板\r\n[00:39.56]人间荒唐古怪\r\n[00:41.89]竹林外 有书斋\r\n[00:44.22]匿于此地畅快\r\n[00:46.50]偏来者不善善者不来\r\n[00:50.74]是我装模作样在瞎掰\r\n[00:55.28]还是他们本就心怀鬼胎\r\n[00:58.17]有人不知悔改\r\n[01:00.56]迷雾中混淆黑白\r\n[01:02.54]在情怀里市侩\r\n[01:05.28]旁人不敢来拆穿\r\n[01:07.26]看似时来运转\r\n[01:09.78]实则在顶风作案\r\n[01:12.06]待曲终又人散\r\n[01:14.49]这一出还有谁在围观\r\n[01:16.84]凡尘修炼二十载\r\n[01:19.16]听闻水能滴石穿\r\n[01:21.44]帝王豪杰风云变幻\r\n[01:23.77]敌不过沧田桑海\r\n[01:26.06]我不关心谁的江山\r\n[01:28.43]只眷恋两小无猜\r\n[01:30.71]兴风作浪不稀罕\r\n[01:33.04]只身固守峨眉山\r\n[01:35.37]一瞬三年五载\r\n[01:37.74]品粗茶 食淡饭\r\n[01:40.13]六界八荒四海\r\n[01:42.40]无人与我来叫板\r\n[01:44.78]人间 荒唐古怪\r\n[01:47.11]竹林外 有书斋\r\n[01:49.43]匿于此地畅快\r\n[01:51.66]偏来者不善善者不来\r\n[01:55.97]是我装模作样在瞎猜\r\n[02:00.54]还是他们本就心怀鬼胎\r\n[02:03.38]有人不知悔改\r\n[02:05.74]迷雾中混淆黑白\r\n[02:07.87]在情怀里市侩\r\n[02:10.45]旁人不敢来拆穿\r\n[02:12.53]看似时来运转\r\n[02:15.05]实则在顶风作案\r\n[02:17.28]待曲终又人散\r\n[02:19.55]这一出还有谁在围观\r\n[02:22.03]静悄悄配唠唠叨叨\r\n[02:24.39]随便瞧瞧我凑凑热闹\r\n[02:26.66]客串也别太潦草\r\n[02:28.95]吃的生蚝要蘸个酱料\r\n[02:31.28]悄悄你唠唠叨叨\r\n[02:33.66]随便瞧瞧你凑的热闹\r\n[02:36.08]听到你做个记号\r\n[02:38.31]请装进书 啥呀\r\n[02:40.63]有人迷途知返\r\n[02:45.17]便是苦尽甘来\r\n[02:49.87]一瞬三年五载\r\n[02:54.48]这 曲终又人散\r\n",
