			"lyrics": "﻿[id:$00000000]\r\n[ar:RAiNBOW计划、雷雨心]\r\n[ti:记念]\r\n[by:]\r\n[hash:1f10162b6d0622ccc8571be387d80ae7]\r\n[al:]\r\n[sign:]\r\n[qq:]\r\n[total:203000]\r\n[offset:0]\r\n[00:00.70]RAiNBOW计划、雷雨心 - 记念\r\n[00:02.30]作词：蒋思涵\r\n[00:03.30]作曲：雷雨心\r\n[00:27.08]时间一转眼就过去了三年\r\n[00:31.65]一切在我心里开的好皎洁\r\n[00:35.95]现在倒计时也不剩几天\r\n[00:40.05]脚边的纸片\r\n[00:42.25]来不及去捡\r\n[00:44.60]仿佛是快要冲破压力的茧\r\n[00:49.00]离校后大家又各自熬夜\r\n[00:53.35]早上的黑眼圈\r\n[00:55.60]课上的小困倦\r\n[00:57.81]一天一天又一天\r\n[01:01.17]我只想要拉住流年\r\n[01:04.07]好好地说声再见\r\n[01:06.52]遗憾感谢都回不去昨天\r\n[01:10.04]我只想铭记这瞬间\r\n[01:13.90]我们一起走过的光年\r\n[01:19.29]六月后光年成纪念\r\n[01:36.01]这个班级太傲娇\r\n[01:38.01]什么课都不发言\r\n[01:40.06]但是还是很温暖\r\n[01:42.42]同学之间的寒暄\r\n[01:45.03]压着课本抄作业\r\n[01:47.13]考试上的看一眼\r\n[01:49.18]现在想起来\r\n[01:50.22]会不会 觉得很亲切\r\n[01:54.60]我只想要拉住流年\r\n[01:57.70]好好地说声再见\r\n[02:00.25]遗憾感谢都回不去昨天\r\n[02:03.65]我只想铭记这瞬间\r\n[02:07.50]我们一起走过的光年\r\n[02:13.11]到达约定好的地点\r\n[02:34.00]我只想要拉住流年\r\n[02:36.95]好好地说声再见\r\n[02:39.10]在心中刻下你们的笑脸\r\n[02:42.93]看流星划过天边\r\n[02:46.74]许下我们的心愿\r\n[02:51.60]让现在成为永远\r\n[02:59.95]永远永远\r\n[03:08.56]啦啦啦\r\n",
