			"lyrics": "﻿[id:$00000000]\r\n[ar:逃跑计划]\r\n[ti:夜空中最亮的星]\r\n[by:]\r\n[hash:e7415d24f9fa9bc88cde1b2d326d1db3]\r\n[al:]\r\n[sign:]\r\n[qq:]\r\n[total:252264]\r\n[offset:0]\r\n[00:00.71]逃跑计划 - 夜空中最亮的星\r\n[00:03.34]作词：逃跑计划\r\n[00:04.81]作曲：逃跑计划\r\n[00:18.32]夜空中最亮的星能否听清\r\n[00:26.82]那仰望的人\r\n[00:29.30]心底的孤独和叹息\r\n[00:35.77]Oh 夜空中最亮的星能否记起\r\n[00:44.57]曾与我同行\r\n[00:46.85]消失在风里的身影\r\n[00:52.66]我祈祷拥有一颗透明的心灵\r\n[00:57.57]和会流泪的眼睛\r\n[01:03.23]给我再去相信的勇气\r\n[01:06.41]Oh 越过谎言去拥抱你\r\n[01:10.41]每当我找不到存在的意义\r\n[01:15.21]每当我迷失在黑夜里\r\n[01:19.75]Oh 夜空中最亮的星\r\n[01:24.05]请指引我靠近你\r\n[01:38.41]夜空中最亮的星是否知道\r\n[01:46.95]曾与我同行的身影\r\n[01:49.98]如今在哪里\r\n[01:55.79]Oh 夜空中最亮的星是否在意\r\n[02:04.33]是等太阳升起\r\n[02:06.86]还是意外先来临\r\n[02:12.82]我宁愿所有痛苦都留在心里\r\n[02:17.42]也不愿忘记你的眼睛\r\n[02:23.39]给我再去相信的勇气\r\n[02:26.33]Oh 越过谎言去拥抱你\r\n[02:30.53]每当我找不到存在的意义\r\n[02:35.14]每当我迷失在黑夜里\r\n[02:39.64]Oh 夜空中最亮的星\r\n[02:44.05]Oh 请照亮我前行\r\n[03:06.12]我祈祷拥有一颗透明的心灵\r\n[03:10.98]和会流泪的眼睛\r\n[03:16.54]给我再去相信的勇 气\r\n[03:19.68]Oh 越过谎言去拥抱你\r\n[03:23.72]每当我找不到存在的意义\r\n[03:28.47]每当我迷失在黑夜里\r\n[03:33.07]Oh 夜空中最亮的星\r\n[03:37.47]Oh 请照亮我前行\r\n[03:51.57]夜空中最亮的星能否听清\r\n[04:00.27]那仰望的人\r\n[04:02.55]心底的孤独和叹息\r\n",
