			"lyrics": "﻿[id:$00000000]\r\n[ar:张叶蕾]\r\n[ti:还是分开]\r\n[by:]\r\n[hash:6882e95b91f5927fc12e2a732f3826c4]\r\n[al:]\r\n[sign:]\r\n[qq:]\r\n[total:0]\r\n[offset:0]\r\n[00:00.52]还是分开 - 张叶蕾\r\n[00:01.30]词：张叶蕾\r\n[00:01.48]曲：张叶蕾\r\n[00:01.66]编曲：宇弘\r\n[00:01.85]吉他：Shawn Tseng\r\n[00:02.03]录音师：Shawn Tseng\r\n[00:02.25]混音工程师：Shawn Tseng\r\n[00:06.21]耶 哦\r\n[00:15.58]眼光瞥向阳台\r\n[00:18.97]你又叼着烟手支着栏杆\r\n[00:22.47]烟雾连风也吹不散\r\n[00:25.73]就像我的思绪\r\n[00:27.17]越思考越混乱\r\n[00:28.90]你就在太阳底下晒\r\n[00:30.93]我在房里傻傻地站\r\n[00:32.83]你不出声仿佛就当我不存在\r\n[00:36.35]我的故事里只有你\r\n[00:38.20]没有任何旁白\r\n[00:39.95]可是最后的情绪 竟是无奈\r\n[00:46.04]竟是空白\r\n[00:49.91]我和你猜了又猜 想过再想\r\n[00:52.24]决定分开\r\n[00:53.37]为什么我们的结局\r\n[00:55.17]还是没有例外\r\n[00:56.95]你说我没有想法 不懂浪漫\r\n[00:59.37]惹人厌烦\r\n[01:00.47]为什么曾经不说\r\n[01:02.36]却拖到了现在\r\n[01:04.17]我和你吵了又吵 闹过再闹\r\n[01:06.56]还是分开\r\n[01:07.64]为什么我在你眼里\r\n[01:09.51]是如此的不堪\r\n[01:11.32]我还是追了出去\r\n[01:12.83]不想在家傻傻等待\r\n[01:14.88]最后只看见车门在我面前\r\n[01:18.08]用力地关\r\n[01:34.16]你掐灭没吸的烟\r\n[01:37.80]大步流星地掠过 我向前\r\n[01:41.23]我用力去抓你的衣角\r\n[01:44.52]以为我挽留你结局就会改变\r\n[01:47.99]你不说一句就要离开\r\n[01:49.73]我在原地喊了又喊\r\n[01:51.64]你不回头仿佛就当我不存在\r\n[01:55.14]我的故事里只有你\r\n[01:56.93]你却走得迫不及待\r\n[01:58.87]剩下来的情节 全是无奈\r\n[02:04.80]竟是空白\r\n[02:08.75]我和你猜了又猜 想过再想\r\n[02:11.08]决定分开\r\n[02:12.21]为什么我们的结局\r\n[02:14.00]还是没有例外\r\n[02:15.82]你说我没有想法 不懂浪漫\r\n[02:18.23]惹人厌烦\r\n[02:19.35]为什么曾经不说\r\n[02:21.12]却拖到了现在\r\n[02:23.07]我和你吵了又吵 闹过再闹\r\n[02:25.40]还是分开\r\n[02:26.50]为什么我在你眼里\r\n[02:28.33]是如此的不堪\r\n[02:30.11]我还是追了出去\r\n[02:31.66]不想在家傻傻等待\r\n[02:33.74]最 后只看见车门在我面前\r\n[02:36.98]用力地关\r\n[02:52.46]呜 挽留也终告失败\r\n[02:57.19]这第一次的恋爱 喔\r\n[03:05.92]我和你猜了又猜 想过再想\r\n[03:08.41]决定分开\r\n[03:09.51]为什么我们的结局\r\n[03:11.33]还是没有例外\r\n[03:13.04]你说我没有想法\r\n[03:14.63]不懂浪漫 惹人厌烦\r\n[03:16.68]为什么曾经不说\r\n[03:18.44]却拖到了现在\r\n[03:20.21]我和你吵了又吵 闹过再闹\r\n[03:22.70]还是分开\r\n[03:23.78]为什么我在你眼里\r\n[03:25.67]是如此的不堪\r\n[03:27.40]我还是追了出 去\r\n[03:28.98]不想在家傻傻等待\r\n[03:30.98]最后只看见车门在我面前\r\n[03:34.13]用力地关\r\n",
