			"author_name": "靳国强",
			"song_name": "你走以后",
			"lyrics": "﻿[id:$00000000]\r\n[ar:靳国强]\r\n[ti:你走以后]\r\n[by:]\r\n[hash:eeaaa9e6d724e89494ce292ffe6eb80a]\r\n[al:]\r\n[sign:]\r\n[qq:]\r\n[total:234866]\r\n[offset:0]\r\n[00:00.50]你走以后 - 靳国强\r\n[00:01.87]词：王恩信Est\r\n[00:03.03]曲：王恩信Est/二胖u\r\n[00:04.85]混音：靳国强\r\n[00:11.46]靳国强：\r\n[00:14.24]在每个失眠的夜晚\r\n[00:15.51]都不由自主想起你\r\n[00:17.17]我还想再见你一面\r\n[00:18.63]可以再次抱你在怀里\r\n[00:20.15]和我的每段回忆\r\n[00:21.26]都在我心里怎么忘记\r\n[00:22.72]最难过的时候我都在身边\r\n[00:24.74]劝你不要放弃\r\n[00:25.85]现在只有一个人躺在空荡的房间里\r\n[00:28.63]努力克制自己的身体\r\n[00:30.05]尽量不去想起你\r\n[00:31.21]临走之前我告诉你别只会活在过去\r\n[00:33.94]像个大人一样清楚\r\n[00:35.19]自己要到达的目的地\r\n[00:36.91]我记得你走那天下了一整天的雨\r\n[00:39.28]回到家中麻木清洗被雨淋湿的身体\r\n[00:42.06]无能为力的感觉像匕首插进在心里\r\n[00:44.84]最后带上耳机播放\r\n[00:46.30]曾为你写 过的歌曲\r\n[00:47.62]你过得还好吗\r\n[00:48.69]我总想这样一系列的问题\r\n[00:50.50]点上一根烟\r\n[00:51.31]和你有关的话题尽量不在提及\r\n[00:53.38]从此独自一个人\r\n[00:54.68]抗拒和你周围的人联系\r\n[00:56.59]漫无目的用酒精麻痹自己假装 忘记\r\n[00:58.72]云u：\r\n[00:59.13]如果季节更替 树叶落地银色满际\r\n[01:04.77]没能走回原地我再做个梦给你\r\n[01:10.33]梦见我们相遇 没有话题满眼笑意\r\n[01:16.01]真的再见到你 再次拥抱你在怀里\r\n[01:29.91]靳国强：\r\n[01:32.58]不知道从 什么时候开始\r\n[01:33.79]我们之间存在各种问题\r\n[01:35.56]不再打电话一起出门\r\n[01:37.27]牵手你都在抗拒\r\n[01:38.49]从每天空闲都在聊天\r\n[01:39.95]到现在的三言两语\r\n[01:41.31]从无话不谈到现在\r\n[01:42.63]根本不知道从何说起\r\n[01:44.09]我们都变得越来越暴躁\r\n[01:45.76]开始不停的争吵\r\n[01:46.82]寻找各种各样的借口\r\n[01:48.03]见面的次数越来越少\r\n[01:49.51]从深夜散步一起到不停的受到嫌弃\r\n[01:52.04]变成现在的样子\r\n[01:53.10]其实很早以前就有预兆\r\n[01:54.84]我总是想你会不会开口\r\n[01:56.26]让这段关系停止\r\n[01:57.42]是否我们的感情\r\n[01:58.73]也会成为生命中的历史\r\n[02:00.55]如果有可能多想回到最初重新开始\r\n[02:03.18]让时间永远停留\r\n[02:04.44]在最好的那段时光静止\r\n[02:06.11]好吧 现在的我已经开始习惯\r\n[02:08.12]没有你的生活\r\n[02:09.14]哪怕偶尔再次想起\r\n[02:10.45]只当那段感情经过\r\n[02:11.76]不再打听你的消息\r\n[02:13.18]都是朋友嘴里听说\r\n[02:14.59]就算听到你有新的开始\r\n[02:16.21]心里难免难过\r\n[02:17.11]云u：\r\n[02:17.52]如果季节更替 树叶落地银色满际\r\n[02:22.89]没能走回原地我再做个梦给你\r\n[02:28.54]梦见我们相遇 没有话题满眼笑意\r\n[02:33.86]真的再见到你 再次拥抱你在怀里\r\n[02:49.67]靳国强：\r\n[02:51.01]直到现在都还保留着你留下的习惯\r\n[02:53.43]每次和你一起出门\r\n[02:54.65]花费从来都不计算\r\n[02:56.31]送你所有贵的礼物 只要是你喜欢\r\n[02:59.09]不想让我们之间存在任何遗憾\r\n[03:01.97]你送我所有的回忆\r\n[03:02.98]我都放在了柜子下面\r\n[03:04.60]包括过生日那年\r\n[03:05.76]你亲手送我的那些东西\r\n[03:07.47]无数次睡醒脑海都是我离开的画面\r\n[03:10.05]既然都过去了\r\n[03:11.21]只能在心里对你说声再见\r\n[03:14.70]Say goodbye\r\n[03:15.35]云u：\r\n[03:15.96]如果季节更替 树叶落地银色满际\r\n[03:21.47]没能走回原地我再做个梦给你\r\n[03:27.08]梦见我们相遇 没有话题满眼笑意\r\n[03:32.63]真的再见到你 再次拥抱你在怀里\r\n[03:38.95]靳国强：\r\n[03:39.84]有人说 喝醉了才知道你最爱谁\r\n[03:44.39]生病了才知道谁最爱你\r\n[03:47.91]这首歌我送给你 再见\r\n",
