			"lyrics": "﻿[id:$00000000]\r\n[ar:许嵩]\r\n[ti:雅俗共赏]\r\n[by:]\r\n[hash:707478cc359452e1057c0f7a526aab4f]\r\n[al:]\r\n[sign:]\r\n[qq:]\r\n[total:249573]\r\n[offset:0]\r\n[00:00.75]许嵩 - 雅俗共赏\r\n[00:02.62]作词：许嵩\r\n[00:03.78]作曲：许嵩\r\n[00:16.06]是否每一部戏都看得完整 场\r\n[00:22.99]是否每一天过得都有多难忘\r\n[00:29.97]表情迟钝可能因为比较爱想\r\n[00:36.96]不擅长眉目表达\r\n[00:42.62]总在盼望总在失望\r\n[00:46.06]日子还不都这样\r\n[00:49.40]俗的无畏雅的轻狂\r\n[00:52.94]还不都是一副臭皮囊\r\n[00:59.69]他们说快写一首情歌\r\n[01:02.57]雅俗共赏\r\n[01:04.29]落笔传神还要容易传唱\r\n[01:07.68]上得厅堂也下得厨房\r\n[01:10.82]就像我一直在找的姑娘\r\n[01:14.66]快写一首情歌雅俗共赏\r\n[01:18.21]打完字谜还要接着打榜\r\n[01:21.64]如果胡同弄堂全都播放\r\n[01:24.83]气韵里居然添了些孤芳自赏\r\n[01:46.56]是否每一场美梦醒来都很爽\r\n[01:53.38]是否每一次成熟\r\n[01:56.32]都徒增了业障\r\n[02:00.42]比痛和痒更多的\r\n[02:03.40]是不痛不痒\r\n[02:07.45]所以我爱进剧场\r\n[02:13.03]总在 盼望总在失望\r\n[02:16.47]日子还不都这样\r\n[02:19.80]俗的无畏雅的轻狂\r\n[02:23.44]还不都是一副臭皮囊\r\n[02:30.19]他们说快写一首情歌\r\n[02:32.92]雅俗共赏\r\n[02:34.59]落笔传神还要容易传唱\r\n[02:38.12]上得厅堂也下得厨房\r\n[02:41.15] 就像我一直在找的姑娘\r\n[02:45.05]快写一首情歌雅俗共赏\r\n[02:48.59]打完字谜还要接着打榜\r\n[02:52.03]如果胡同弄堂全都播放\r\n[02:55.06]气韵里居然添了些孤芳自赏\r\n[03:02.98]谁的故事有营养\r\n[03:06.07]大俗或大雅的都在理直气壮\r\n[03:10.09]洒狗血或白雪的现场\r\n[03:13.78]都邀我观赏\r\n[03:15.50]还真是大方\r\n[03:19.85]快写一首情歌雅俗共赏\r\n[03:23.39]落笔传神还要容易传唱\r\n[03:26.88]上得厅堂也下得厨房\r\n[03:29.97]就像我一直在找的姑娘\r\n[03:34.08]有没有一种生活雅俗共赏\r\n[03:37.32]情节起伏跌宕让人向往\r\n[03:40.86]满纸荒唐中窥见满脸沧桑\r\n[03:44.00]触到神经就要懂得鼓掌\r\n[03:47.34]别说一不在乎二没期望\r\n[03:50.88]太超脱中枪中奖感觉会一样\r\n",
