			"lyrics": "﻿[id:$00000000]\r\n[ar:Aki阿杰、银临]\r\n[ti:牵丝戏]\r\n[by:]\r\n[hash:662c3b849f4c5903016e529ed2f5963c]\r\n[al:]\r\n[sign:]\r\n[qq:]\r\n[total:239438]\r\n[offset:0]\r\n[00:00.16]Aki阿杰、 银临 - 牵丝戏\r\n[00:00.92]作词：Vagary\r\n[00:01.02]作曲：银临\r\n[00:24.56]嘲笑谁恃美扬威\r\n[00:29.94]没了心如何相配\r\n[00:34.84]盘铃声清脆\r\n[00:37.63]帷幕间灯火幽微\r\n[00:40.41]我和你\r\n[00:41.83]最天生一对\r\n[00:46.73]没了你才算原罪\r\n[00:52.25]没了心才好相配\r\n[00:57.16]你褴褛我彩绘\r\n[00:59.90]并肩行过山与水\r\n[01:02.79]你憔悴\r\n[01:04.21]我替你明媚\r\n[01:08.25]是你吻开笔墨\r\n[01:11.10]染我眼角珠泪\r\n[01:13.93]演离合相遇悲喜为谁\r\n[01:19.41]他们迂 回误会\r\n[01:22.34]我却只由你支配\r\n[01:25.07]问世间哪有更完美\r\n[01:30.44]兰花指捻红尘似水\r\n[01:36.02]三尺红台\r\n[01:38.15]万事入歌吹\r\n[01:41.58]唱别久悲不成悲\r\n[01:44.57]十分红处竟成灰\r\n[01:47.40]愿谁记得谁\r\n[01:49.47]最 好的年岁\r\n[02:16.06]你一牵我舞如飞\r\n[02:21.63]你一引我懂进退\r\n[02:26.49]苦乐都跟随\r\n[02:29.27]举手投足不违背\r\n[02:32.10]将谦卑\r\n[02:33.42]温柔成绝对\r\n[02:37.62]你错我不肯对\r\n[02:40.40]你懵懂我蒙昧\r\n[02:43.24]心火怎甘心 扬汤止沸\r\n[02:48.76]你枯我不曾萎\r\n[02:51.55]你倦我也不敢累\r\n[02:54.33]用什么暖你一千岁\r\n[02:59.74]风雪依稀秋白发尾\r\n[03:05.31]灯火葳蕤\r\n[03:07.38]揉皱你眼眉\r\n[03:10.77]假如你舍一滴泪\r\n[03:13.91]假如老去我能陪\r\n[03:16.74]烟波里成灰\r\n[03:18.81]也去得完美\r\n[03:22.10]风雪依稀秋白发尾\r\n[03:27.62]灯火葳蕤\r\n[03:29.70]揉皱你眼眉\r\n[03:33.14]假如你舍一滴泪\r\n[03:36.28]假如老去我能陪\r\n[03:39.07]烟波里成灰\r\n[03:41.14]也去得完美\r\n",
