			"lyrics": "﻿[id:$00000000]\r\n[ar:房东的猫]\r\n[ti:云烟成雨]\r\n[by:]\r\n[hash:86e8bf58a5a367aad23e84bef976bba3]\r\n[al:]\r\n[sign:]\r\n[qq:]\r\n[total:240837]\r\n[offset:0]\r\n[00:00.70]房东的猫 - 云烟成雨\r\n[00:02.43]作词：墨鱼丝\r\n[00:03.56]作曲：少年佩\r\n[00:18.11]你的晚安\r\n[00:21.04]是下意识的恻隐\r\n[00:24.64]我留至夜深\r\n[00:26.99]治疗失眠梦呓\r\n[00:30.79]那封手写信\r\n[00:33.48]留在行李箱底\r\n[00:36.11]来不及赋予它旅途的意义\r\n[00:43.67]若一切都已云烟成雨\r\n[00:49.31]我能否变成淤泥\r\n[00:52.73]再一次沾染你\r\n[00:56.29]若生命如过场电影\r\n[01:01.21]Oh让我 再一次甜梦里惊醒\r\n[01:13.50]我多想再见你\r\n[01:15.50]哪怕匆匆一眼就别离\r\n[01:19.47]路灯下昏黄的剪影\r\n[01:22.68]越走越漫长的林径\r\n[01:25.72]我多想再见你\r\n[01:28.12]至少玩笑话还能说起\r\n[01:31.83]街巷初次落叶的秋分\r\n[01:35.25]渐行渐远去的我们\r\n[01:53.15]若一切都已云烟成雨\r\n[01:58.91]我能否变成淤泥\r\n[02:02.23]再一次沾染你\r\n[02:05.56]若生命如过场电影\r\n[02:10.63]Oh让我再一次甜梦里惊醒\r\n[02:19.92]我多想再见你\r\n[02:21.61]哪怕匆匆一眼就别离\r\n[02:25.69]路灯下昏黄的剪影\r\n[02:28.90]越走越漫长的林径\r\n[02:32.07]我多想再见你\r\n[02:34.47]至少玩笑话还能说起\r\n[02:37.84]街巷初次落叶的秋分\r\n[02:41.47]渐行渐远去的我们\r\n[02:49.68]站台汽笛响起\r\n[02:52.54]想念是你的声音\r\n[02:55.56]我们提着过去走入人群\r\n[03:01.98]寻找着一个位置安放自己\r\n[03:13.79]我多想再见你\r\n[03:15.83]哪怕匆匆一眼就别离\r\n[03:19.52]路灯下昏黄的剪影\r\n[03:22.63]越走越漫长的林径\r\n[03:26.10]我多想再见你\r\n[03:28.05]至少玩笑话还能说起\r\n[03:31.67]街巷初次落叶的秋分\r\n[03:35.09]渐行渐远去的我们\r\n",
