			"lyrics": "﻿[id:$00000000]\r\n[ar:薛之谦]\r\n[ti:演员]\r\n[by:]\r\n[hash:a774a794184af17469b27963e120b565]\r\n[al:]\r\n[sign:]\r\n[qq:]\r\n[total:261022]\r\n[offset:0]\r\n[00:00.19]薛之谦 - 演员\r\n[00:00.94]作词：薛之谦\r\n[00:01.31]作曲：薛之谦\r\n[00:01.61]编曲：郑伟、张宝宇\r\n[00:21.18]简单点说话的方式简单点\r\n[00:30.30]递进的情绪请省略\r\n[00:33.63]你又不是个演员\r\n[00:36.23]别设计那些情节\r\n[00:42.06]没意见\r\n[00:46.07]我只想看看你怎么圆\r\n[00:51.66]你难过得太表面\r\n[00:54.65]像没天赋的演员\r\n[00:57.29]观众一眼能看见\r\n[01:02.51]该配合你演出的我\r\n[01:05.15]演视而不见\r\n[01:07.69]在逼一个最爱你的人\r\n[01:10.67]即兴表演\r\n[01:12.96]什么时候我们开始\r\n[01:15.54]收起了底线\r\n[01:18.16]顺应时代的改变看\r\n[01:20.52]那些拙劣的表演\r\n[01:23.46]可你曾经那么爱我\r\n[01:25.74]干嘛演出细节\r\n[01:28.64]我该变成什么样子\r\n[01:30.98]才能延缓厌倦\r\n[01:33.92]原来当爱放下防备后的\r\n[01:36.86]这些那些\r\n[01:39.45]才是考验\r\n[01:45.13]没 意见\r\n[01:48.98]你想怎样我都随便\r\n[01:54.93]你演技也有限\r\n[01:57.46]又不用说感言\r\n[02:00.12]分开就平淡些\r\n[02:05.30]该配合你演出的我\r\n[02:07.92]演视而不见\r\n[02:10.56]别逼一个最爱你的人\r\n[02:13.55]即兴表演\r\n[02:15.86]什 么时候我们开始\r\n[02:18.44]没有了底线\r\n[02:21.04]顺着别人的谎言被动\r\n[02:23.68]就不显得可怜\r\n[02:26.32]可你曾经那么爱我\r\n[02:28.61]干嘛演出细节\r\n[02:31.52]我该变成什么样子\r\n[02:33.83]才能配合出演\r\n[02:36.75]原来当爱放下防 备后的\r\n[02:39.66]这些那些\r\n[02:41.93]都有个期限\r\n[02:47.97]其实台下的观众就我一个\r\n[02:53.16]其实我也看出你有点不舍\r\n[02:58.36]场景也习惯我们来回拉扯\r\n[03:02.97]还计较着什么\r\n[03:08.87]其实说分不开的也不见得\r\n[03:14.11] 其实感情最怕的就是拖着\r\n[03:19.31]越演到重场戏越哭不出了\r\n[03:24.23]是否还值得\r\n[03:29.10]该配合你演出的我\r\n[03:31.84]尽力在表演\r\n[03:34.40]像情感节目里的嘉宾\r\n[03:37.45]任人挑选\r\n[03:39.73]如果还能看出我有\r\n[03:42.32]爱 你的那面\r\n[03:44.89]请剪掉那些情节让我\r\n[03:47.93]看上去体面\r\n[03:50.17]可你曾经那么爱我干嘛\r\n[03:53.15]演出细节\r\n[03:55.43]不在意的样子\r\n[03:57.41]是我最后的表演\r\n[04:01.26]是因为爱你我才选择\r\n[04:04.21]表演这种成全\r\n",
