			"lyrics": "﻿[id:$00000000]\r\n[ar:净音]\r\n[ti:左手指月 (甜美女声版)]\r\n[by:]\r\n[hash:8ed70f76e6b95a0e92c52036b1d08186]\r\n[al:]\r\n[sign:]\r\n[qq:]\r\n[total:186096]\r\n[offset:0]\r\n[00:00.00]净音 - 左手指月 (甜美女声版)\r\n[00:00.79]作词：喻江\r\n[00:01.00]作曲：萨顶顶\r\n[00:26.13]左手握大地右手握着天\r\n[00:32.35]掌纹裂出了十方的闪电\r\n[00:38.07]把时光匆匆兑换成了年\r\n[00:44.71]三千年 如所不见\r\n[00:51.96]左手拈着花右手舞着剑\r\n[00:58.67]眉间落了下一万年的雪\r\n[01:04.23]一滴泪 啊啊啊\r\n[01:10.98]那是我 啊啊啊\r\n[01:18.78]左手一弹指右手弹着弦\r\n[01:24.91]舟楫摆渡在忘川的水间\r\n[01:30.74]当烦恼能开出一朵红莲\r\n[01:37.31]莫停歇 给我杂念\r\n[01:57.92]左手化成羽右手成鳞片\r\n[02:04.38]某世在云上某世在林间\r\n[02:10.21]愿随你用一粒微尘模样\r\n[02:16.79]在所有 尘世浮现\r\n[02:23.73]我左手拿起你右手放下你\r\n[02:30.77]合掌时你全部被收回心间\r\n[02:36.49]一炷香 啊啊 啊\r\n[02:43.02]你是我 无二无别\r\n",
