			"lyrics": "﻿[id:$00000000]\r\n[ar:黄诗扶]\r\n[ti:九万字]\r\n[by:]\r\n[hash:d5e394c859d20b095070adbbfc80c2e6]\r\n[al:]\r\n[sign:]\r\n[qq:]\r\n[total:232010]\r\n[offset:0]\r\n[00:01.20]黄诗扶 - 九万字\r\n[00:01.90]作词：左木修\r\n[00:02.10]作曲：WH宇恒、黄诗扶\r\n[00:07.75]当坊间最善舞的女儿死了\r\n[00:12.97]京城就该有一场大雪\r\n[00:23.08]飘泊的雪 摇曳回风\r\n[00:26.63]诗意灵魂 更迭情人\r\n[00:30.33]总惯用轻浮的茂盛 掩抹深沉\r\n[00:37.73]有谁不是 少年热诚\r\n[00:41.48]孑然一身 爱一个人\r\n[00:45.18]望尽了毕生温柔眼神\r\n[00:51.18]写得出最刻薄的字文\r\n[00:56.98]以讥诮这庸尘\r\n[01:00.33]却不忍 斥你毫分\r\n[01:05.38]我也算万种风情 实非良人\r\n[01:10.10]谁能有幸 错付终身\r\n[01:13.30]最先动情的人\r\n[01:15.55]剥去利刃 沦为人臣\r\n[01:20.10]我爱你苍凉双眼 明月星辰\r\n[01:24.85]不远万里 叩入心门\r\n[01:28.15]一个孤僻的唇\r\n[01:30.40]摘获了你首肯 献上一吻\r\n[01:55.38]有谁不是 死而寻生\r\n[01:58.98]险些终结 险些长命\r\n[02:02.73]睡梦中无数次的自刎\r\n[02:08.79]笔下有最淋漓的爱恨\r\n[02:14.54]以剜挑这浮生\r\n[02:17.89]只写你 衣不染尘\r\n[02:22.92]我也算万种风情 实非良人\r\n[02:27.62]谁能有幸 错付终身\r\n[02:30.82]幻想岁月无声\r\n[02:33.22]百年之后 合于一坟\r\n[02:37.62]我爱你苍凉双眼 留有余温\r\n[02:42.37]荒芜的心 旷野徒奔\r\n[02:45.62]你会弹落烟尘 抹去指上灰痕\r\n[02:52.07]各自纷呈\r\n[02:56.21]看那些 流离失所的游魂\r\n[03:00.71]莫衷一是 层层围困\r\n[03:04.08]从来酿酒的人\r\n[03:06.38]分外清醒 独善其身\r\n[03:10.88]常言说 命 运半点不由人\r\n[03:15.28]不信常言 偏信方寸\r\n[03:18.88]那些荒唐传闻\r\n[03:21.18]化名称为青春\r\n[03:25.33]红尘滚滚\r\n",
