			"lyrics": "﻿[id:$00000000]\r\n[ar:鹿乃 (かの)]\r\n[ti:心做し (无心)]\r\n[by:]\r\n[hash:76af90b7ba141b65b180d07447144757]\r\n[al:]\r\n[sign:]\r\n[qq:]\r\n[total:0]\r\n[offset:0]\r\n[00:00.11]双笙 - 心做し\r\n[00:01.34]作词：蝶々P\r\n[00:01.48]作曲：蝶々P\r\n[00:02.04]ねぇもしも\r\n[00:04.13]全て投げ捨てられたら\r\n[00:07.63]笑って生きることが\r\n[00:11.34]楽になるの？\r\n[00:13.26]また胸が痛くなるから\r\n[00:17.54]もう何も言わないでよ\r\n[00:47.72]ねぇもしも\r\n[00:49.66]全て忘れられたなら\r\n[00:53.30]泣かないで生きることも\r\n[00:57.02]楽になるの？\r\n[00:59.13]でもそんな事出来ないから\r\n[01:03.31]もう何も見せ ないでよ\r\n[01:09.02]君にどれだけ近づいても\r\n[01:14.85]僕の心臓は一つだけ\r\n[01:20.62]酷いよ酷いよ\r\n[01:23.22]もういっそ僕の体を\r\n[01:26.14]壊して引き裂いて\r\n[01:29.01]好きなようにしてよ\r\n[01:31.89]叫んで藻掻いて\r\n[01:34.72]瞼を腫らしても\r\n[01:37.54]まだ君は僕の事を\r\n[01:40.47]抱きしめて離さない\r\n[01:43.29]もういいよ\r\n[01:56.25]ねぇもしも\r\n[01:58.25]僕の願いが叶うなら\r\n[02:02.03]君と同じものが欲しいんだ\r\n[02:07.68]でも僕には存在しないから\r\n[02:11.80]じゃあせめて此処に来てよ\r\n[02:43.44]君にどれだけ愛されても\r\n[02:49.12]僕の心臓は一つだけ\r\n[02:54.83]やめてよやめてよ\r\n[02:57.72]優しくしないでよ\r\n[03:00.49]どうしても僕には\r\n[03:03.34]理解ができないよ\r\n[03:06.22] 痛いよ痛いよ\r\n[03:09.00]言葉で教えてよ\r\n[03:11.99]こんなの知らないよ\r\n[03:14.74]独りにしないで\r\n[03:17.80]酷いよ酷いよ\r\n[03:20.43]もういっそ僕の体を\r\n[03:23.20]壊して引き裂いて\r\n[03:26.13]好きなようにしてよ\r\n[03:28.98]叫 んで藻掻いて\r\n[03:31.87]瞼を腫らしても\r\n[03:34.64]まだ君は僕の事を\r\n[03:37.62]抱きしめて離さない\r\n[03:40.47]もういいよ\r\n[04:04.84]ねぇもしも\r\n[04:06.89]僕に心があるなら\r\n[04:10.52]どうやって\r\n[04:12.53]それを見つければい いの？\r\n[04:16.21]少し微笑んで君が言う\r\n[04:20.32]「それはねここにあるよ」\r\n",
